import React, { useState, useEffect } from 'react';
import HabitList from './components/HabitList';
import AddHabitForm from './components/AddHabitForm';
import Analytics from './components/Analytics';
import Dashboard from './components/Dashboard';

const App = () => {
  const [habits, setHabits] = useState([]);
  const [categories, setCategories] = useState([
    { id: 1, name: 'Health', color: '#28a745' }, // Green
    { id: 2, name: 'Work', color: '#007bff' },   // Blue
    { id: 3, name: 'Personal', color: '#ffc107' }, // Yellow
    { id: 4, name: 'Uncategorized', color: '#6c757d' }, // Gray
  ]);
  const [theme, setTheme] = useState('light');
  const [activeTab, setActiveTab] = useState('habits');
  const [layout, setLayout] = useState('default');

  useEffect(() => {
    const storedHabits = JSON.parse(localStorage.getItem('habits'));
    if (storedHabits) {
      setHabits(storedHabits);
    }
    const storedTheme = localStorage.getItem('theme');
    if (storedTheme) {
      setTheme(storedTheme);
    }
  }, []);

  useEffect(() => {
    localStorage.setItem('habits', JSON.stringify(habits));
    localStorage.setItem('theme', theme);
    document.body.className = theme === 'dark' ? 'bg-dark text-white' : '';
  }, [habits, theme]);

  const addHabit = (habit) => {
    setHabits([
      ...habits,
      { ...habit, id: Date.now(), history: [], notes: [], frequency: habit.frequency, isTimeBased: habit.isTimeBased, targetDuration: habit.targetDuration },
    ]);
  };

  const deleteHabit = (id) => {
    setHabits(habits.filter((habit) => habit.id !== id));
  };

  const trackHabit = (id, duration = null) => {
    setHabits(
      habits.map((habit) =>
        habit.id === id
          ? { ...habit, history: [...habit.history, { date: new Date(), duration: duration }] }
          : habit
      )
    );
  };

  const addNote = (id, note) => {
    setHabits(
      habits.map((habit) =>
        habit.id === id
          ? { ...habit, notes: [...habit.notes, { id: Date.now(), text: note }] }
          : habit
      )
    );
  };

  const toggleTheme = () => {
    setTheme(theme === 'light' ? 'dark' : 'light');
  };

  return (
    <div className={`container mt-5 ${theme}`}>
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h1 className="text-center">Habit Tracker</h1>
        <button className="btn btn-secondary" onClick={toggleTheme}>
          <i className={`bi bi-${theme === 'light' ? 'moon' : 'sun'}`}></i>
        </button>
      </div>

      <ul className="nav nav-tabs mb-4">
        <li className="nav-item">
          <button
            className={`nav-link ${activeTab === 'habits' ? 'active' : ''}`}
            onClick={() => setActiveTab('habits')}
          >
            Habits
          </button>
        </li>
        <li className="nav-item">
          <button
            className={`nav-link ${activeTab === 'analytics' ? 'active' : ''}`}
            onClick={() => setActiveTab('analytics')}
          >
            Analytics
          </button>
        </li>
        <li className="nav-item">
          <button
            className={`nav-link ${activeTab === 'dashboard' ? 'active' : ''}`}
            onClick={() => setActiveTab('dashboard')}
          >
            Dashboard
          </button>
        </li>
        <li className="nav-item dropdown">
          <button
            className="nav-link dropdown-toggle"
            data-bs-toggle="dropdown"
            href="#"
            role="button"
            aria-expanded="false"
          >
            Layout
          </button>
          <ul className="dropdown-menu">
            <li>
              <a className="dropdown-item" href="#" onClick={() => setLayout('default')}>
                Default
              </a>
            </li>
            <li>
              <a className="dropdown-item" href="#" onClick={() => setLayout('analytics-first')}>
                Analytics First
              </a>
            </li>
            <li>
              <a className="dropdown-item" href="#" onClick={() => setLayout('full-width-habits')}>
                Full Width Habits
              </a>
            </li>
          </ul>
        </li>
      </ul>

      {activeTab === 'habits' && (
        <>
          <AddHabitForm addHabit={addHabit} categories={categories} />
          <HabitList
            habits={habits}
            deleteHabit={deleteHabit}
            trackHabit={trackHabit}
            addNote={addNote}
            categories={categories}
          />
        </>
      )}

      {activeTab === 'analytics' && (
        <Analytics habits={habits} categories={categories} />
      )}

      {activeTab === 'dashboard' && (
        <Dashboard
          habits={habits}
          categories={categories}
          deleteHabit={deleteHabit}
          trackHabit={trackHabit}
          addNote={addNote}
          layout={layout}
        />
      )}
    </div>
  );
};

export default App;
